import { Add, AddShoppingCartOutlined, Remove } from "@mui/icons-material";
import React from "react";
import styled from "styled-components";
import Fotter from "../components/Fotter";
import Navbar from "../components/Navbar";
import Newsletter from "../components/Newsletter";
import { Notification } from "../components/Notification";

const Container = styled.div``;

const Wrapper = styled.div`
  display: flex;
  padding: 50px;
`;

const ImageContainer = styled.div`
  flex: 1;
  padding: 0px 50 px;
`;

const Image = styled.img`
  width: 80%;
  height: 70vh;
  object-fit: fill;
`;

const InfoContainer = styled.div`
  flex: 1;
`;

const Title = styled.h1`
  font-weight: 500;
`;

const Desc = styled.p`
  margin: 10px 0px;
`;

const Price = styled.div`
  font-size: 40px;
  font-weight: 200;
`;

const FilterContainer = styled.div`
    width: 50%;
    margin: 30px 0px;
    display: flex;
    justify-content: space-between;
`
const Filter = styled.div`
    display: flex;
    align-items: center;

`
const FilterTitle = styled.span`
    font-size: 20px;
    font-weight: 200;
`
const FilterColor = styled.div`
    width: 20px;
    height: 20px;
    border-radius: 50%;
    background-color: #${(props)=>props.color};
    margin: 0px 5px;
    cursor: pointer;
`
const FilterSize = styled.select`
    margin-left: 5px;
   padding: 5px;
`
const FilterSizeOption = styled.div`
    
`
const AddContainer = styled.div`
    display: flex;
    align-items: center;
    width: 50%;
    color: black;
    justify-content: space-between;
`

const AmontContainer = styled.div`
    display: flex;
    align-items: center;
    font-weight: 700;

`
const Amount = styled.span`

    width: 30px;
    height: 30px;
    border-radius: 10px;
    border: 1px solid black;
    display: flex;
    align-items: center;
    justify-content: center;
    margin: 0px 5px;

`
const Button = styled.button`
    padding: 15px;
    border:  1px solid black;
     background-color: #0037ff;
     cursor: pointer;
     font-weight: bold;
`


const Product = () => {
  return (
    <Container>
      <Navbar />
      <Notification />
      <Wrapper>
        <ImageContainer>
          <Image src="https://pyxis.nymag.com/v1/imgs/bb0/eed/6358d4c5bd77144e979582eab417e32207-hanes-white-tagless.rsquare.w600.jpg" />
        </ImageContainer>
        <InfoContainer>
          <Title>T-Shirt</Title>
          <Desc>
            One of few designs with a front and back logo. This popular shark
            crunch over Muscle beach is perfect for any occasion. Custom Muscle
            Beach neck tag Super soft Spectra Spun ring-spun 100% cotton
            perfection fabric Unisex 100% NAFTA compliant
          </Desc>
          <Price> RS.1,500</Price>
          <FilterContainer>
            <Filter>
              <FilterTitle>Color</FilterTitle>
              <FilterColor color="000000" />
              <FilterColor color="00008B" />
              <FilterColor color="808080" />
            </Filter>
            <Filter>
              <FilterTitle>Size</FilterTitle>
              <FilterSize>
                <FilterSizeOption>XS</FilterSizeOption>
                <FilterSizeOption>S</FilterSizeOption>
                <FilterSizeOption>M</FilterSizeOption>
                <FilterSizeOption>L</FilterSizeOption>
                <FilterSizeOption>XL</FilterSizeOption>
              </FilterSize>
            </Filter>
          </FilterContainer>
          <AddContainer>
            <AmontContainer>
                <Remove/>
                <Amount>1</Amount>
                <Add/>
            </AmontContainer>
            <Button><AddShoppingCartOutlined/> Add To Cart</Button>
          </AddContainer>
        </InfoContainer>
      </Wrapper>

      <Newsletter />
      <Fotter />
    </Container>
  );
};

export default Product;
